const InnerBox = () => {
    return (
        <div className="inner-box">
            <h2>
                Fashion <span>MEGA SALE</span>
            </h2>

            <h2>
                50% OFF
            </h2>
            <h3>
                ON ORDER ABOVE $999
            </h3>
            <button>
                SHOP NOW
            </button>
        </div>
    );
}

export default InnerBox;
